syntax = "proto3";
option java_package = "emu.grasscutter.net.proto";
import "ItemHint.proto";
import "ForgeQueueManipulateType.proto";


message ForgeQueueManipulateRsp {
	int32 retcode = 10;
	ForgeQueueManipulateType manipulate_type = 8;
	repeated ItemHint extra_output_item_list = 9;
	repeated ItemHint output_item_list = 12;
	repeated ItemHint return_item_list = 3;
}